import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import { useState } from 'react';
import Button from 'react-bootstrap/Button';
import Collapse from 'react-bootstrap/Collapse';
import { Row, Col } from 'react-bootstrap';
import Card from 'react-bootstrap/Card';
import Offcanvas from 'react-bootstrap/Offcanvas';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars } from '@fortawesome/free-solid-svg-icons';



import './navbar.css';
function NavBar() {

  const [show, setShow] = useState(false);

  const handleClose = () => setShow(false);
  const handleShow = () => setShow(true);



  return (
    <div>
      <Navbar expand="lg" className="bg-body-tertiary border-bottom">
        <Container>
          <Navbar.Brand href="#home">Musicia</Navbar.Brand>
          <Navbar.Toggle className='toggle'>
            <Button variant='btn' onClick={handleShow}>
              <FontAwesomeIcon icon={faBars}></FontAwesomeIcon>
            </Button>
          </Navbar.Toggle>
        </Container>
      </Navbar>
      <Row className='main'>
        <Col lg="2" className="d-none d-lg-block">
          <div className='mt-2'>
            <div className='aside-item'>
              <a>
                <div>
                  <h5 className='ms-5 mt-5'>Songs</h5>
                </div>
              </a>
            </div>
            <div className='aside-item'>
              <a>
                <div>
                  <h5 className='ms-5 mt-5'>Playlists</h5>
                </div>
              </a>
            </div>
            <div className='aside-item'>
              <a>
                <div>
                  <h5 className='ms-5 mt-5'>Liked</h5>
                </div>
              </a>
            </div>
          </div>
        </Col>
        <Col lg="10" className='cont'>
          main
        </Col>
      </Row>




      <Offcanvas show={show} onHide={handleClose}>
        <Offcanvas.Header closeButton>
          <Offcanvas.Title>Musicia</Offcanvas.Title>
        </Offcanvas.Header>
        <Offcanvas.Body>
          
        </Offcanvas.Body>
      </Offcanvas>

    </div>

  );
}

export default NavBar;
